import { NavLink } from "react-router-dom";

const Navbar = () => {
  return <div>
    <div>
      <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR1GHFzicMYaZPHv7YBikNwffrogSMVnTvLsQ&usqp=CAU" alt="" />
    </div>
    <div>
      <NavLink to="/">Home</NavLink>
      <NavLink to="/cart">Cart</NavLink>
    </div>
  </div>;
};

export default Navbar;
